import React from 'react';
import { Button } from '@material-ui/core'

const EditCompany = ({company}) => {
    const { name, address, url } = company
    return (
        <div>
            <h1>{company.name}</h1>
            <h3>{company.address}</h3>
            <h3>{company.url}</h3>
            <Button variant="contained" color="primary">Edit Company</Button>
        </div>

    )
}

export default EditCompany;
